import React from 'react';
import logo from 'src/component/images/logo.svg';
  
const Home = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>Welcome to GeeksforGeeks</h1>
      <img src={logo} className="App-logo" alt="logo" />
    </div>


  );
};
  
export default Home;
